"    Meningocele",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 559px; height: 172px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Transvaginal ultrasound scan of a 27 week fetus showing a cystic structure in the midline consistent with a meningocele.",
"    <br>",
"     (A) The calipers are demarcating the area of the skull defect measuring 0.7 cm.",
"     <br>",
"      (B) A zoomed view of the area of the connection between the cyst and the brain.",
"      <br>",
"       (C) Power Doppler demonstrates a vessel arising from the brain which connects to the meningocele. The diagnosis was confirmed at postnatal surgery.",
"       <div class=\"footnotes\">",
"       </div>",
"       <div class=\"reference\">",
"        Courtesy of Ana Monteagudo, MD.",
"       </div>",
"      </br>",
"     </br>",
