"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=DERM%2F50249%7EDERM%2F72261&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
