" <div id=\"topicContent\">",
"  <div id=\"topicTitle\">",
"   Overview of aerobic exercise testing in children and adolescents",
"  </div>",
"  <div id=\"topicContributors\">",
"   <div>",
"    <a id=\"authors\">",
"    </a>",
"    <a class=\"contributor contributor_credentials contributorType\" href=\"mobipreview.htm?42/31/43513/contributors\">",
"     Authors",
"    </a>",
"    <br/>",
