var title_f42_31_43515="Dysfunc cog styles";
var content_f42_31_43515=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ONC%2F62075&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ONC%2F62075&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Dysfunctional cognitive styles",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr class=\"divider_bottom\">",
"       <td>",
"        <strong>",
"         Catastrophization",
"        </strong>",
"       </td>",
"       <td>",
"        The patient always assumes and expects the worst possible outcome. Imagined negative scenarios are accepted as certain. Any minor problem or setback is interpreted as clear indication that the illness is rapidly progressing and death is imminent, or that no one will care for him/her, even when there is no evidence supporting the belief. For example, if a family member is delayed and does not visit at the usual time, the patient may develop the belief that \"no one cares for me, and I will die in pain and alone\".",
"       </td>",
"      </tr>",
"      <tr class=\"divider_bottom\">",
"       <td>",
"        <strong>",
"         Overgeneralization",
"        </strong>",
"       </td>",
"       <td>",
"        The patient generalizes beyond the objective facts of a situation and interprets a negative event as a sign that things will just go badly. For example, a patient who experiences adverse effects from a pain medication may over generalize to all pain medication and think \"I cannot tolerate pain medication. This is a sign that my pain cannot be treated. I will not be able to find relief; no medication will work for me; the pain will just get worse\".",
"       </td>",
"      </tr>",
"      <tr class=\"divider_bottom\">",
"       <td>",
"        <strong>",
"         Dichotomous thinking",
"        </strong>",
"       </td>",
"       <td>",
"        This style is commonly described as \"black or white thinking\". The patient tends to polarize on the negative side of the spectrum and feel like a complete failure if the performance is not what was expected.",
"       </td>",
"      </tr>",
"      <tr class=\"divider_bottom\">",
"       <td>",
"        <strong>",
"         Filtering",
"        </strong>",
"       </td>",
"       <td>",
"        The patient emphasizes the negative details of a communication or situation and discounts positive evidence.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Emotional reasoning",
"        </strong>",
"       </td>",
"       <td>",
"        The patient cannot differentiate between internal states and outside reality. Every emotional state is interpreted as a fact.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
