var title_f42_31_43517="Presentation of hyperparathyroidism";
var content_f42_31_43517=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ENDO%2F62696&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=0\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ENDO%2F62696&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=0\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 515px\">",
"   <div class=\"ttl\">",
"    Changing presentation of primary hyperparathyroidism",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 495px; height: 224px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Different patterns of presentation of primary hyperparathyroidism in three different time periods. The latest survey shows that 80 percent of patients are asymptomatic and discovered incidentally on routine blood screening; bone disease (osteitis fibrosa cystica), on the other hand, has virtually disappeared as a presenting symptom. Bone disease was assessed by x-rays and bone densitometry; patients with skeletal involvement by bone density measurement were not included.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from: Cope O, N Engl J Med 1966; 274:1174; Heath H III, et al, N Engl J Med 1980; 302:189; and Silverberg SJ, et al, Am J Med 1990; 89:327.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
var script_f42_31_43517=[""].join("\n");
