var title_f42_31_43518="Determinants of plasma sodium";
var content_f42_31_43518=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=NEPH%2F71817&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=NEPH%2F71817&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Determinants of the plasma sodium concentration",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 286px; height: 255px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Among both normal subjects and patients with a variety of diseases, there is a very close correlation between the plasma water sodium concentration and the ratio of total body exchangeable solutes (primarily Na salts in the extracellular fluid + K salts in the cells) to the total body water (TBW). The exchangeable portion is used since about 30 percent of the body Na and a smaller fraction of the body K are bound in areas such as bone where they are \"nonexchangeable\" and therefore osmotically inactive.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Adapted from Edelman I, Leibman J, O'Meara MP,&nbsp;et al.&nbsp;J Clin Invest 1958; 37:1236, by copyright permission of the American Society for Clinical Investigation.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
